import React from "react";
import "./App.css";
import { stockData } from "./data";

export const Stocks = () => {
    return (
      <>
        <HomePageHeader />
        <div className="stock-container">
          {stockData.map((data, key) => {
            return (
              <div key={key}>
                <Stock
                  key={key}
                  name={data.name}
                  animal={data.animal}
                  gender={data.gender}
                  age={data.age}
                  location={data.location}
                />
              </div>
            );
          })}
        </div>
      </>
    );
  };

export const HomePageHeader = () => {
    return (
      <header className="header">
        <h2>Your Stock Tracker</h2>
      </header>
    );
  };

 export const Stock = ({ name, animal, gender, age, location }) => {
    if (!name) return <div />;
    return (
      <table>
        <tbody>
          <tr>
            <td>
              <h5>{name}</h5>
            </td>
            <td>
              <h5>{animal}</h5>
            </td>
            <td>
              <h4>{gender}</h4>
            </td>
            <td>
              <p>{age}</p>
            </td>
            <td>
              <p>{location}</p>
            </td>
          </tr>
        </tbody>
      </table>
    );
  };
